componentsModule.modules.url={isFree:function(){let response=true;postData(URI+"api/articles.exists.url",{api:{url:componentsModule.modules.url.serialize().url,ignore:document.querySelector("div.content-wrapper").getAttribute("data-id")}},function(b,a){if(a==="success"&&b.success===true){response=!(b.data.result)}});return response},start:function(){let current=componentsModule.modules.url;current.parentElement=document.querySelector("[data-component=url]");current.inputElement=current.parentElement.querySelector("input");current.messageElement=current.parentElement.querySelector(".validate-message");componentsModule.initializeEvent({event:"keyup change",element:current.inputElement,content:function(){showValidationResult(current.messageElement,"COMPONENT_URL_INVALID",current.validate(),reloadPackery)}})},resume:function(){let current=componentsModule.modules.url;const b=current.parentElement.getAttribute("data-resume");if(b===""){return true}const a=JSON.parse(b);current.inputElement.value=a.url;triggerEvent(current.inputElement,"change")},validate:function(){let current=componentsModule.modules.url;const a=current.serialize().url;if(!/^[a-z][a-z0-9\-]+[a-z]$/.test(a)){return false}if(a.length<3||a.length>120){return false}return(current.isFree())},serialize:function(){return{url:componentsModule.modules.url.inputElement.value.trim()}}};